import { BrowserRouter, Routes, Route, Outlet } from "react-router-dom";


function About() {
    return (
      <>

                <h1>Welcome to Restore Beauty</h1>
                <p>Organic, non-toxic, holistic skincare products</p>

                <h5>Come visit our headquarters</h5>
                <img id="pic" className="img-fluid" src="https://images.unsplash.com/photo-1643391448961-621e0b1bc5b1?w=400&auto=format&fit=crop&q=60&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxzZWFyY2h8NDN8fGhlYWRxdWFydGVyc3xlbnwwfHwwfHx8Mg%3D%3D" alt="ShiggiJam" />

            <Outlet />
        </>


    )
  }

  export default About
